export default function RectangularShapes({x, y, length, breadth }) {
    const smallerTextStyles = {
        fontSize: '20px',
    };
    return (
        <rect
            class="cls-1"
            x= {x}
            y= {y}
            width= {length}
            height={breadth}
        />
    );
}
